import React, {useState} from "react";

function MessageFeed(props) {
    const [messages, setMessages] = useState([]);

    function addMessage(props) {
        setMessages(messages.concat(<p className='card-text'>{props.message}</p>));
        console.log("test");
    }

    return(
            <div className="card border-secondary mb-3 h-100 flex-grow-1 rounded-0">
                <div className="card-header rounded-0">Chat Room</div>
                <div className="card-body">
                    {messages}
                </div>
            </div>
    );
}

export default MessageFeed;
